	(294,3,8,X'706C616E6172436F6E66696775726174696F6E','PlanarConfiguration','Indicates whether pixel components are recorded in chunky or planar format. In JPEG compressed files a JPEG marker is used instead of this tag. If this field does not exist, the TIFF default of 1 (chunky) is assumed.'),
	(295,3,8,X'7265736F6C7574696F6E556E6974','ResolutionUnit','The unit for measuring XResolution and YResolution. The same unit is used for both XResolution and YResolution. If the image resolution in unknown, 2 (inches) is designated.'),
	(296,3,8,X'7472616E7366657246756E6374696F6E','TransferFunction','A transfer function for the image, described in tabular style. Normally this tag is not necessary, since color space is specified in the color space information tag (ColorSpace).'),
	(297,3,8,X'736F667477617265','Software','The name and version of the software or firmware of the camera or image input device used to generate the image.'),
	(298,3,8,X'6461746554696D65','DateTime','The date and time of image creation. In this standard it is the date and time the file was changed.'),
	(299,3,8,X'617274697374','Artist','Person who created the image'),
	(300,3,8,X'7768697465506F696E74','WhitePoint','The chromaticity of the white point of the image. Normally this tag is not necessary, since color space is specified in the color space information tag (ColorSpace).'),
	(301,3,8,X'7072696D6172794368726F6D617469636974696573','PrimaryChromaticities','The chromaticity of the three primary colors of the image. Normally this tag is not necessary, since color space is specified in the color space information tag (ColorSpace).'),
	(302,3,8,X'6A706567496E7465726368616E6765466F726D6174','JPEGInterchangeFormat','The offset to the start byte (SOI) of JPEG compressed thumbnail data. This is not used for primary image JPEG data.'),
	(303,3,8,X'6A706567496E7465726368616E6765466F726D61744C656E677468','JPEGInterchangeFormatLength','The number of bytes of JPEG compressed thumbnail data. This is not used for primary image JPEG data.'),
	(304,3,8,X'7943624372436F656666696369656E7473','YCbCrCoefficients','The matrix coefficients for transformation from RGB to YCbCr image data.'),
	(305,3,8,X'794362437253756253616D706C696E67','YCbCrSubSampling','The sampling ratio of chrominance components in relation to the luminance component. In JPEG compressed data a JPEG marker is used instead of this tag.'),
	(306,3,8,X'7943624372506F736974696F6E696E67','YCbCrPositioning','The position of chrominance components in relation to the luminance component. This field is designated only for JPEG compressed data or uncompressed YCbCr data.'),
	(307,3,8,X'7265666572656E6365426C61636B5768697465','ReferenceBlackWhite','The reference black point value and reference white point value. The color space is declared in a color space information tag, with the default being the value that gives the optimal image characteristics Interoperability these conditions.'),
	(308,3,8,X'636F70797269676874','Copyright','Copyright information. In this standard the tag is used to indicate both the photographer and editor copyrights. It is the copyright notice of the person or organization claiming rights to the image.'),
	(309,3,8,X'657869665F4946445F506F696E746572','Exif IFD Pointer','A pointer to the Exif IFD, which is a set of tags for recording Exif-specific attribute information.'),
	(310,3,8,X'677073496E666F5F4946445F506F696E746572','GPSInfo IFD Pointer','A pointer to the GPS IFD, which is a set of tags for recording GPS information.'),
	(311,3,8,X'6578706F7375726554696D65','ExposureTime','Exposure time, given in seconds (sec).'),
	(312,3,8,X'664E756D626572','FNumber','F number'),
	(313,3,8,X'6578706F7375726550726F6772616D','ExposureProgram','The class of the program used by the camera to set exposure when the picture is taken.'),
	(314,3,8,X'737065637472616C53656E7369746976697479','SpectralSensitivity','Indicates the spectral sensitivity of each channel of the camera used. The tag value is an ASCII string compatible with the standard developed by the ASTM Technical committee.'),
	(315,3,8,X'69736F5370656564526174696E6773','ISOSpeedRatings','Indicates the ISO Speed and ISO Latitude of the camera or input device as specified in ISO 12232.'),
	(316,3,8,X'6F656366','OECF','Indicates the Opto-Electric Conversion Function (OECF) specified in ISO 14524. OECF is the relationship between the camera optical input and the image values.'),
	(317,3,8,X'6578696656657273696F6E','ExifVersion','Exif Version'),
	(318,3,8,X'6461746554696D654F726967696E616C','DateTimeOriginal','The date and time when the original image data was generated. For a DSC the date and time the picture was taken are recorded.'),
	(319,3,8,X'6461746554696D654469676974697A6564','DateTimeDigitized','The date and time when the image was stored as digital data. If, for example, an image was captured by DSC and at the same time the file was recorded, then the DateTimeOriginal and DateTimeDigitized will have the same contents.'),
	(320,3,8,X'636F6D706F6E656E7473436F6E66696775726174696F6E','ComponentsConfiguration','Information specific to compressed data. The channels of each component are arranged in order from the 1st component to the 4th. For uncompressed data the data arrangement is given in the PhotometricInterpretation tag. However, since PhotometricInterpretation can only express the order of Y,Cb and Cr, this tag is provided for cases when compressed data uses components other than Y, Cb, and Cr and to enable support of other sequences.'),
	(321,3,8,X'636F6D7072657373656442697473506572506978656C','CompressedBitsPerPixel','Information specific to compressed data. The compression mode used for a compressed image is indicated in unit bits per pixel.'),
	(322,3,8,X'73687574746572537065656456616C7565','ShutterSpeedValue','Shutter speed. The unit is the APEX (Additive System of Photographic Exposure) setting'),
	(323,3,8,X'617065727475726556616C7565','ApertureValue','The lens aperture. The unit is the APEX value.'),
	(324,3,8,X'6272696768746E65737356616C7565','BrightnessValue','The value of brightness. The unit is the APEX value. Ordinarily it is given in the range of -99.99 to 99.99. Note that if the numerator of the recorded value is FFFFFFFF.H, Unknown shall be indicated.'),
	(325,3,8,X'6578706F737572654269617356616C7565','ExposureBiasValue','The exposure bias. The unit is the APEX value. Ordinarily it is given in the range of -99.99 to 99.99.'),
	(326,3,8,X'6D6178417065727475726556616C7565','MaxApertureValue','The smallest F number of the lens. The unit is the APEX value. Ordinarily it is given in the range of 00.00 to 99.99, but it is not limited to this range.'),
	(327,3,8,X'7375626A65637444697374616E6365','SubjectDistance','The distance to the subject, given in meters. Note that if the numerator of the recorded value is FFFFFFFF.H, Infinity shall be indicated; and if the numerator is 0, Distance unknown shall be indicated.'),
	(328,3,8,X'6D65746572696E674D6F6465','MeteringMode','Metering mode, such as CenterWeightedAverage, Spot, MultiSpot,Pattern, Partial etc.'),
	(329,3,8,X'6C69676874536F75726365','LightSource','Light source such as Daylight, Tungsten, Flash etc.'),
	(330,3,8,X'666C617368','Flash','The status of flash when the image was shot.'),
	(331,3,8,X'666F63616C4C656E677468','FocalLength','The actual focal length of the lens, in mm. Conversion is not made to the focal length of a 35 mm film camera.'),
	(332,3,8,X'7375626A65637441726561','SubjectArea','The location and area of the main subject in the overall scene.'),
	(333,3,8,X'6D616B65724E6F7465','MakerNote','Manufacturer notes'),
	(334,3,8,X'75736572436F6D6D656E74','UserComment','A tag for Exif users to write keywords or comments on the image besides those in ImageDescription, and without the character code limitations of the ImageDescription tag. The character code used in the UserComment tag is identified based on an ID code in a fixed 8-byte area at the start of the tag data area.'),
	(335,3,8,X'73756253656354696D65','SubSecTime','DateTime subseconds'),
	(336,3,8,X'73756253656354696D654F726967696E616C','SubSecTimeOriginal','DateTimeOriginal subseconds'),
	(337,3,8,X'73756253656354696D654469676974697A6564','SubSecTimeDigitized','DateTimeDigitized subseconds'),
	(338,3,8,X'666C61736870697856657273696F6E','FlashpixVersion','The Flashpix format version supported by a FPXR file. If the FPXR function supports Flashpix format Ver. 1.0, this is indicated similarly to ExifVersion by recording \"0100\" as 4-byte ASCII.'),
	(339,3,8,X'636F6C6F725370616365','ColorSpace','The color space information tag (ColorSpace) is always recorded as the color space specifier. Normally sRGB (=1) is used to define the color space based on the PC monitor conditions and environment.'),
	(340,3,8,X'706978656C5844696D656E73696F6E','PixelXDimension','Information specific to compressed data. When a compressed file is recorded, the valid width of the meaningful image shall be recorded in this tag, whether or not there is padding data or a restart marker. This tag should not exist in an uncompressed file.'),
	(341,3,8,X'706978656C5944696D656E73696F6E','PixelYDimension','Information specific to compressed data. When a compressed file is recorded, the valid height of the meaningful image shall be recorded in this tag, whether or not there is padding data or a restart marker. This tag should not exist in an uncompressed file. Since data padding is unnecessary in the vertical direction, the number of lines recorded in this valid image height tag will in fact be the same as that recorded in the SOF.'),
	(342,3,8,X'72656C61746564536F756E6446696C65','RelatedSoundFile','Related audio file'),
	(343,3,8,X'696E7465726F7065726162696C6974795F4946445F506F696E746572','Interoperability IFD Pointer','A pointer to the Interoperability IFD, which is composed of tags storing the information to ensure the Interoperability'),
	(344,3,8,X'666C617368456E65726779','FlashEnergy','The strobe energy at the time the image is captured, as measured in Beam Candle Power Seconds (BCPS).'),
	(345,3,8,X'7370617469616C4672657175656E6379526573706F6E7365','SpatialFrequencyResponse','This tag records the camera or input device spatial frequency table and SFR values in the direction of image width, image height, and diagonal direction, as specified in ISO 12233.'),
	(346,3,8,X'666F63616C506C616E65585265736F6C7574696F6E','FocalPlaneXResolution','The number of pixels in the image width (X) direction per FocalPlaneResolutionUnit on the camera focal plane.'),
	(347,3,8,X'666F63616C506C616E65595265736F6C7574696F6E','FocalPlaneYResolution','The number of pixels in the image height (Y) direction per FocalPlaneResolutionUnit on the camera focal plane.'),
	(348,3,8,X'666F63616C506C616E655265736F6C7574696F6E556E6974','FocalPlaneResolutionUnit','The unit for measuring FocalPlaneXResolution and FocalPlaneYResolution. This value is the same as the ResolutionUnit.'),
	(349,3,8,X'7375626A6563744C6F636174696F6E','SubjectLocation','The location of the main subject in the scene. The value of this tag represents the pixel at the center of the main subject relative to the left edge, prior to rotation processing as per the Rotation tag. The first value indicates the X column number and second indicates the Y row number.'),
	(350,3,8,X'6578706F73757265496E646578','ExposureIndex','The exposure index selected on the camera or input device at the time the image is captured.'),
	(351,3,8,X'73656E73696E674D6574686F64','SensingMethod','The image sensor type on the camera or input device, such as One-chip color area sensor etc.'),
	(352,3,8,X'66696C65536F75726365','FileSource','The image source. If a DSC recorded the image, this tag value of this tag always be set to 3, indicating that the image was recorded on a DSC.'),
	(353,3,8,X'7363656E6554797065','SceneType','The type of scene. If a DSC recorded the image, this tag value shall always be set to 1, indicating that the image was directly photographed.'),
	(354,3,8,X'6366615061747465726E','CFAPattern','The color filter array (CFA) geometric pattern of the image sensor when a one-chip color area sensor is used. It does not apply to all sensing methods.'),
	(355,3,8,X'637573746F6D52656E6465726564','CustomRendered','The use of special processing on image data, such as rendering geared to output. When special processing is performed, the reader is expected to disable or minimize any further processing.'),
	(356,3,8,X'6578706F737572654D6F6465','ExposureMode','the exposure mode set when the image was shot. In auto-bracketing mode, the camera shoots a series of frames of the same scene at different exposure settings.'),
	(357,3,8,X'776869746542616C616E6365','WhiteBalance','The white balance mode set when the image was shot.'),
	(358,3,8,X'6469676974616C5A6F6F6D526174696F','DigitalZoomRatio','The digital zoom ratio when the image was shot. If the numerator of the recorded value is 0, this indicates that digital zoom was not used.'),
	(359,3,8,X'666F63616C4C656E677468496E33356D6D46696C6D','FocalLengthIn35mmFilm','The equivalent focal length assuming a 35mm film camera, in mm. A value of 0 means the focal length is unknown. Note that this tag differs from the FocalLength tag.'),
	(360,3,8,X'7363656E654361707475726554797065','SceneCaptureType','The type of scene that was shot. It can also be used to record the mode in which the image was shot, such as Landscape, Portrait etc. Note that this differs from the scene type (SceneType) tag.'),
	(361,3,8,X'6761696E436F6E74726F6C','GainControl','The degree of overall image gain adjustment.'),
	(362,3,8,X'636F6E7472617374','Contrast','The direction of contrast processing applied by the camera when the image was shot.'),
	(363,3,8,X'73617475726174696F6E','Saturation','The direction of saturation processing applied by the camera when the image was shot.'),
	(364,3,8,X'73686172706E657373','Sharpness','The direction of sharpness processing applied by the camera when the image was shot.'),
	(365,3,8,X'64657669636553657474696E674465736372697074696F6E','DeviceSettingDescription','Information on the picture-taking conditions of a particular camera model. The tag is used only to indicate the picture-taking conditions in the reader.'),
	(366,3,8,X'7375626A65637444697374616E636552616E6765','SubjectDistanceRange','The distance to the subject, such as Macro, Close View or Distant View.'),
	(367,3,8,X'696D616765556E697175654944','ImageUniqueID','An identifier assigned uniquely to each image. It is recorded as an ASCII string equivalent to hexadecimal notation and 128-bit fixed length.'),
	(368,3,8,X'67707356657273696F6E4944','GPSVersionID','The version of GPSInfoIFD. The version is given as 2.2.0.0. This tag is mandatory when GPSInfo tag is present.'),
	(369,3,8,X'6770734C61746974756465526566','GPSLatitudeRef','Indicates whether the latitude is north or south latitude. The ASCII value \'N\' indicates north latitude, and \'S\' is south latitude.'),
	(370,3,8,X'6770734C61746974756465','GPSLatitude','The latitude, expressed as three values giving the degrees, minutes, and seconds, respectively.'),
	(371,3,8,X'6770734C6F6E676974756465526566','GPSLongitudeRef','Indicates whether the longitude is east or west longitude. ASCII \'E\' indicates east longitude, and \'W\' is west longitude.'),
	(372,3,8,X'6770734C6F6E676974756465','GPSLongitude','The longitude, expressed as three values giving the degrees, minutes, and seconds, respectively.'),
	(373,3,8,X'677073416C746974756465526566','GPSAltitudeRef','Indicates the altitude used as the reference altitude. If the reference is sea level and the altitude is above sea level, 0 is given. If the altitude is below sea level, a value of 1 is given and the altitude is indicated as an absolute value in the GPSAltitude tag. The reference unit is meters.'),
	(374,3,8,X'677073416C746974756465','GPSAltitude','The altitude based on the reference in GPSAltitudeRef. Altitude is expressed as one RATIONAL value. The reference unit is meters.'),
	(375,3,8,X'67707354696D655374616D70','GPSTimeStamp','The time as UTC (Coordinated Universal Time). TimeStamp is expressed as three RATIONAL values giving the hour, minute, and second.'),
	(376,3,8,X'677073536174656C6C69746573','GPSSatellites','The GPS satellites used for measurements. This tag can be used to describe the number of satellites, their ID number, angle of elevation, azimuth, SNR and other information in ASCII notation. The format is not specified. If the GPS receiver is incapable of taking measurements, value of the tag shall be set to NULL.'),
	(377,3,8,X'677073537461747573','GPSStatus','The status of the GPS receiver when the image is recorded. \'A\' means measurement is in progress, and \'V\' means the measurement is Interoperability.'),
	(378,3,8,X'6770734D6561737572654D6F6465','GPSMeasureMode','The GPS measurement mode. \'2\' means two-dimensional measurement and \'3\' means three-dimensional measurement is in progress.'),
	(379,3,8,X'677073444F50','GPSDOP','The GPS DOP (data degree of precision). An HDOP value is written during two-dimensional measurement, and PDOP during three-dimensional measurement.'),
	(380,3,8,X'6770735370656564526566','GPSSpeedRef','The unit used to express the GPS receiver speed of movement. \'K\' \'M\' and \'N\' represents kilometers per hour, miles per hour, and knots.'),
	(381,3,8,X'6770735370656564','GPSSpeed','The speed of GPS receiver movement.'),
	(382,3,8,X'677073547261636B526566','GPSTrackRef','The reference for giving the direction of GPS receiver movement. \'T\' denotes true direction and \'M\' is magnetic direction.'),
	(383,3,8,X'677073547261636B','GPSTrack','The direction of GPS receiver movement. The range of values is from 0.00 to 359.99.'),
	(384,3,8,X'677073496D67446972656374696F6E526566','GPSImgDirectionRef','The reference for giving the direction of the image when it is captured. \'T\' denotes true direction and \'M\' is magnetic direction.'),
	(385,3,8,X'677073496D67446972656374696F6E','GPSImgDirection','The direction of the image when it was captured. The range of values is from 0.00 to 359.99.'),
	(386,3,8,X'6770734D6170446174756D','GPSMapDatum','The geodetic survey data used by the GPS receiver. If the survey data is restricted to Japan, the value of this tag is \'TOKYO\' or \'WGS-84\'. If a GPS Info tag is recorded, it is strongly recommended that this tag be recorded.'),
	(387,3,8,X'677073446573744C61746974756465526566','GPSDestLatitudeRef','Reference for latitude of destination'),
	(388,3,8,X'677073446573744C61746974756465','GPSDestLatitude','Latitude of destination, expressed as three values giving the degrees, minutes, and seconds, respectively.'),
	(389,3,8,X'677073446573744C6F6E676974756465526566','GPSDestLongitudeRef','Reference for longitude of destination'),
	(390,3,8,X'677073446573744C6F6E676974756465','GPSDestLongitude','Longitude of destination, expressed as three values giving the degrees, minutes, and seconds, respectively.'),
	(391,3,8,X'6770734465737442656172696E67526566','GPSDestBearingRef','Indicates the reference used for giving the bearing to the destination point. \'T\' denotes true direction and \'M\' is magnetic direction.'),
	(392,3,8,X'6770734465737442656172696E67','GPSDestBearing','The bearing to the destination point. The range of values is from 0.00 to 359.99.'),
	(393,3,8,X'6770734465737444697374616E6365526566','GPSDestDistanceRef','Indicates the unit used to express the distance to the destination point. \'K\', \'M\' and \'N\' represent kilometers, miles and knots.'),
	(394,3,8,X'6770734465737444697374616E6365','GPSDestDistance','The distance to the destination point.'),
	(395,3,8,X'67707350726F63657373696E674D6574686F64','GPSProcessingMethod','A character string recording the name of the method used for location finding. The first byte indicates the character code used, and this is followed by the name of the method.'),
	(396,3,8,X'67707341726561496E666F726D6174696F6E','GPSAreaInformation','A character string recording the name of the GPS area. The first byte indicates the character code used, and this is followed by the name of the GPS area.'),
	(397,3,8,X'677073446174655374616D70','GPSDateStamp','date and time information relative to UTC (Coordinated Universal Time). The record format is \"YYYY:MM:DD\" while converted to W3C-DTF to use in RDF'),
	(398,3,8,X'677073446966666572656E7469616C','GPSDifferential','Indicates whether differential correction is applied to the GPS receiver.'),
	(399,3,8,X'696E7465726F7065726162696C697479496E646578','InteroperabilityIndex','Indicates the identification of the Interoperability rule. \'R98\' = conforming to R98 file specification of Recommended Exif Interoperability Rules (ExifR98) or to DCF basic file stipulated by Design Rule for Camera File System. \'THM\' = conforming to DCF thumbnail file stipulated by Design rule for Camera File System.'),
	(400,3,8,X'696E7465726F7065726162696C69747956657273696F6E','InteroperabilityVersion','Interoperability Version'),
	(401,3,8,X'72656C61746564496D61676546696C65466F726D6174','RelatedImageFileFormat','Related image file format'),
	(402,3,8,X'72656C61746564496D6167655769647468','RelatedImageWidth','Related image width'),
	(403,3,8,X'72656C61746564496D6167654C656E677468','RelatedImageLength','Related image length'),
	(404,3,8,X'7072696E74496D6167654D61746368696E675F4946445F506F696E746572','PrintImageMatching IFD Pointer','A pointer to the print image matching IFD'),
	(405,3,8,X'70696D436F6E7472617374','PrintIM Contrast','Contrast info for print image matching'),
	(406,3,8,X'70696D4272696768746E657373','PrintIM Brightness','Brightness info for print image matching'),
	(407,3,8,X'70696D436F6C6F7242616C616E6365','PrintIM ColorBalance','ColorBalance info for print image matching'),
	(408,3,8,X'70696D53617475726174696F6E','PrintIM Saturation','Saturation info for print image matching'),
	(409,3,8,X'70696D53686172706E657373','PrintIM Sharpness','Sharpness info for print image matching'),
