	(416,3,10,X'736F75726365446174655374617274','sourceDateStart','The start timestamp of the interval over which the Source resource should be interpreted as being applicable to the Annotation.'),
	(417,3,10,X'737566666978','suffix','The snippet of text that occurs immediately after the text which is being selected.'),
	(418,3,10,X'7374796C65644279','styledBy','A reference to a Stylesheet that should be used to apply styles to the Annotation rendering.'),
	(419,3,10,X'686173546172676574','hasTarget','The relationship between an Annotation and its Target.'),
	(420,3,10,X'636163686564536F75726365','cachedSource','A object of the relationship is a copy of the Source resource\'s representation, appropriate for the Annotation.'),
	(421,3,10,X'686173456E6453656C6563746F72','hasEndSelector','The relationship between a RangeSelector and the Selector that describes the end position of the range. '),
	(422,3,10,X'74657874446972656374696F6E','textDirection','The direction of the text of the subject resource. There MUST only be one text direction associated with any given resource.'),
	(423,3,10,X'70726F63657373696E674C616E6775616765','processingLanguage','The object of the property is the language that should be used for textual processing algorithms when dealing with the content of the resource, including hyphenation, line breaking, which font to use for rendering and so forth.  The value must follow the recommendations of BCP47.'),
	(424,3,10,X'63616E6F6E6963616C','canonical','A object of the relationship is the canonical IRI that can always be used to deduplicate the Annotation, regardless of the current IRI used to access the representation.'),
	(425,3,10,X'736F7572636544617465456E64','sourceDateEnd','The end timestamp of the interval over which the Source resource should be interpreted as being applicable to the Annotation.'),
	(426,3,10,X'686173507572706F7365','hasPurpose','The purpose served by the resource in the Annotation.'),
	(427,3,10,X'626F647956616C7565','bodyValue','The object of the predicate is a plain text string to be used as the content of the body of the Annotation.  The value MUST be an  xsd:string  and that data type MUST NOT be expressed in the serialization. Note that language MUST NOT be associated with the value either as a language tag, as that is only available for  rdf:langString .\n  '),
	(428,3,10,X'7374796C65436C617373','styleClass','The name of the class used in the CSS description referenced from the Annotation that should be applied to the Specific Resource.'),
	(429,3,10,X'686173537461727453656C6563746F72','hasStartSelector','The relationship between a RangeSelector and the Selector that describes the start position of the range. '),
	(430,3,10,X'68617353636F7065','hasScope','The scope or context in which the resource is used within the Annotation.'),
	(431,3,10,X'6861735374617465','hasState','The relationship between the ResourceSelection, or its subclass SpecificResource, and a State resource. Please note that the domain ( oa:ResourceSelection ) is not used directly in the Web Annotation model.'),
	(432,3,10,X'6578616374','exact','The object of the predicate is a copy of the text which is being selected, after normalization.'),
