	(124,3,10,X'48747470526571756573745374617465','HttpRequestState','The HttpRequestState class is used to record the HTTP request headers that a client SHOULD use to request the correct representation from the resource. '),
	(125,3,10,X'4373735374796C65','CssStyle','A resource which describes styles for resources participating in the Annotation using CSS.'),
	(126,3,10,X'585061746853656C6563746F72','XPathSelector',' An XPathSelector is used to select elements and content within a resource that supports the Document Object Model via a specified XPath value.'),
	(127,3,10,X'54657874506F736974696F6E53656C6563746F72','TextPositionSelector','The TextPositionSelector describes a range of text by recording the start and end positions of the selection in the stream. Position 0 would be immediately before the first character, position 1 would be immediately before the second character, and so on.'),
	(128,3,10,X'43737353656C6563746F72','CssSelector','A CssSelector describes a Segment of interest in a representation that conforms to the Document Object Model through the use of the CSS selector specification.'),
	(129,3,10,X'53766753656C6563746F72','SvgSelector','An SvgSelector defines an area through the use of the Scalable Vector Graphics [SVG] standard. This allows the user to select a non-rectangular area of the content, such as a circle or polygon by describing the region using SVG. The SVG may be either embedded within the Annotation or referenced as an External Resource.'),
	(130,3,10,X'467261676D656E7453656C6563746F72','FragmentSelector','The FragmentSelector class is used to record the segment of a representation using the IRI fragment specification defined by the representation\'s media type.'),
	(131,3,10,X'5465787451756F746553656C6563746F72','TextQuoteSelector','The TextQuoteSelector describes a range of text by copying it, and including some of the text immediately before (a prefix) and after (a suffix) it to distinguish between multiple copies of the same sequence of characters.'),
	(132,3,10,X'5465787475616C426F6479','TextualBody',''),
	(133,3,10,X'44617461506F736974696F6E53656C6563746F72','DataPositionSelector','DataPositionSelector describes a range of data by recording the start and end positions of the selection in the stream. Position 0 would be immediately before the first byte, position 1 would be immediately before the second byte, and so on. The start byte is thus included in the list, but the end byte is not.'),
	(134,3,10,X'43686F696365','Choice','A subClass of  as:OrderedCollection  that conveys to a consuming application that it should select one of the resources in the  as:items  list to use, rather than all of them.  This is typically used to provide a choice of resources to render to the user, based on further supplied properties.  If the consuming application cannot determine the user\'s preference, then it should use the first in the list.'),
	(135,3,10,X'5374617465','State','A State describes the intended state of a resource as applied to the particular Annotation, and thus provides the information needed to retrieve the correct representation of that resource.'),
	(136,3,10,X'5265736F7572636553656C656374696F6E','ResourceSelection','Instances of the ResourceSelection class identify part (described by an oa:Selector) of another resource (referenced with oa:hasSource), possibly from a particular representation of a resource (described by an oa:State). Please note that ResourceSelection is not used directly in the Web Annotation model, but is provided as a separate class for further application profiles to use, separate from oa:SpecificResource which has many Annotation specific features.'),
	(137,3,10,X'53656C6563746F72','Selector','A resource which describes the segment of interest in a representation of a Source resource, indicated with oa:hasSelector from the Specific Resource. This class is not used directly in the Annotation model, only its subclasses.'),
	(138,3,10,X'5374796C65','Style','A Style describes the intended styling of a resource as applied to the particular Annotation, and thus provides the information to ensure that rendering is consistent across implementations.'),
	(139,3,10,X'53706563696669635265736F75726365','SpecificResource','Instances of the SpecificResource class identify part of another resource (referenced with oa:hasSource), a particular representation of a resource, a resource with styling hints for renders, or any combination of these, as used within an Annotation.'),
	(140,3,10,X'52616E676553656C6563746F72','RangeSelector','A Range Selector can be used to identify the beginning and the end of the selection by using other Selectors. The selection consists of everything from the beginning of the starting selector through to the beginning of the ending selector, but not including it.'),
	(141,3,10,X'54696D655374617465','TimeState','A TimeState records the time at which the resource\'s state is appropriate for the Annotation, typically the time that the Annotation was created and/or a link to a persistent copy of the current version.'),
	(142,3,10,X'416E6E6F746174696F6E','Annotation','The class for Web Annotations.'),
	(143,3,10,X'446972656374696F6E','Direction','A class to encapsulate the different text directions that a textual resource might take.  It is not used directly in the Annotation Model, only its three instances.'),
	(144,3,10,X'4D6F7469766174696F6E','Motivation','The Motivation class is used to record the user\'s intent or motivation for the creation of the Annotation, or the inclusion of the body or target, that it is associated with.'),
	(150,3,12,X'5A6F6E65','Zone','Used to group annotations together in an area of a Canvas, for example to model columns, foldouts or palimpsests; Note that Zones are not currently used in the IIIF Presentation API.'),
	(151,3,12,X'416E6E6F746174696F6E4C697374','AnnotationList','AnnotationLists are an ordered list of Annotation objects. Typically all Annnotations in a list target the same Canvas'),
	(152,3,12,X'53657175656E6365','Sequence','The sequence conveys the ordering of the views of the object.'),
	(153,3,12,X'56696577696E6748696E74','ViewingHint',NULL),
	(154,3,12,X'43616E766173','Canvas','The canvas represents an individual page or view and acts as a central point for laying out the different content resources that make up the display.'),
	(155,3,12,X'4C61796572','Layer','Layers are lists of AnnotationLists to group them together, for example to create the set of lists that make up a particular translation/edition of a text'),
	(156,3,12,X'4D616E6966657374','Manifest','The manifest resource represents a single object and any intellectual work or works embodied within that object'),
	(157,3,12,X'52616E6765','Range','Ranges describe additional structure within an object, such as newspaper articles that span pages, the range of non-content-bearing pages at the beginning of a work, or chapters within a book'),
