	(212,3,14,X'52656A656374416374696F6E','RejectAction','<p>The act of rejecting to/adopting an object.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/AcceptAction\">AcceptAction</a>: The antonym of RejectAction.</li>\n</ul>\n'),
	(213,3,14,X'4576656E745265736572766174696F6E','EventReservation','A reservation for an event like a concert, sporting event, or lecture.</p>\n\n<p>Note: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use <a class=\"localLink\" href=\"http://schema.org/Offer\">Offer</a>.'),
