	(447,3,14,X'57617272616E747953636F7065','WarrantyScope','<p>A range of of services that will be provided to a customer free of charge in case of a defect or malfunction of a product.</p>\n\n<p>Commonly used values:</p>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#Labor-BringIn</li>\n<li>http://purl.org/goodrelations/v1#PartsAndLabor-BringIn</li>\n<li>http://purl.org/goodrelations/v1#PartsAndLabor-PickUp</li>\n</ul>\n'),
	(448,3,14,X'5075626C69636174696F6E4973737565','PublicationIssue','A part of a successively published publication such as a periodical or publication volume, often numbered, usually containing a grouping of works such as articles.</p>\n\n<p><a href=\"http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html\">blog post</a>.'),
	(449,3,14,X'506572666F726D416374696F6E','PerformAction','The act of participating in performance arts.'),
	(450,3,14,X'466C696768745265736572766174696F6E','FlightReservation','A reservation for air travel.</p>\n\n<p>Note: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use <a class=\"localLink\" href=\"http://schema.org/Offer\">Offer</a>.'),
	(451,3,14,X'536F667477617265536F75726365436F6465','SoftwareSourceCode','Computer programming source code. Example: Full (compile ready) solutions, code snippet samples, scripts, templates.'),
