	(453,3,14,X'41636869657665416374696F6E','AchieveAction','The act of accomplishing something via previous efforts. It is an instantaneous action rather than an ongoing process.'),
	(454,3,14,X'526576696577416374696F6E','ReviewAction','The act of producing a balanced opinion about the object for an audience. An agent reviews an object with participants resulting in a review.'),
	(455,3,14,X'4576656E7453746174757354797065','EventStatusType','EventStatusType is an enumeration type whose instances represent several states that an Event may be in.'),
	(456,3,14,X'53656174','Seat','Used to describe a seat, such as a reserved seat in an event reservation.'),
	(457,3,14,X'436F75727365','Course','A description of an educational course which may be offered as distinct instances at which take place at different times or take place at different locations, or be offered through different media or modes of study. An educational course is a sequence of one or more educational events and/or creative works which aims to build knowledge, competence or ability of learners.'),
	(458,3,14,X'4D6F76696554686561746572','MovieTheater','A movie theater.'),
	(459,3,14,X'456475636174696F6E616C41756469656E6365','EducationalAudience','An EducationalAudience.'),
	(460,3,14,X'556E6974507269636553706563696669636174696F6E','UnitPriceSpecification','The price asked for a given offer by the respective organization or person.'),
	(461,3,14,X'506572736F6E','Person','A person (alive, dead, undead, or fictional).'),
	(462,3,14,X'4469676974616C446F63756D656E745065726D697373696F6E','DigitalDocumentPermission','A permission for a particular person or group to access a particular file.'),
	(463,3,14,X'5061796D656E7443617264','PaymentCard','A payment method using a credit, debit, store or other card to associate the payment with an account.'),
	(464,3,14,X'5175657374696F6E','Question','A specific question - e.g. from a user seeking answers online, or collected in a Frequently Asked Questions (FAQ) document.'),
	(465,3,14,X'557064617465416374696F6E','UpdateAction','The act of managing by changing/editing the state of the object.'),
	(466,3,14,X'456E747279506F696E74','EntryPoint','An entry point, within some Web-based protocol.'),
	(467,3,14,X'427573696E65737346756E6374696F6E','BusinessFunction','<p>The business function specifies the type of activity or access (i.e., the bundle of rights) offered by the organization or business person through the offer. Typical are sell, rental or lease, maintenance or repair, manufacture / produce, recycle / dispose, engineering / construction, or installation. Proprietary specifications of access rights are also instances of this class.</p>\n\n<p>Commonly used values:</p>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#ConstructionInstallation</li>\n<li>http://purl.org/goodrelations/v1#Dispose</li>\n<li>http://purl.org/goodrelations/v1#LeaseOut</li>\n<li>http://purl.org/goodrelations/v1#Maintain</li>\n<li>http://purl.org/goodrelations/v1#ProvideService</li>\n<li>http://purl.org/goodrelations/v1#Repair</li>\n<li>http://purl.org/goodrelations/v1#Sell</li>\n<li>http://purl.org/goodrelations/v1#Buy</li>\n</ul>\n'),
	(468,3,14,X'46696E64416374696F6E','FindAction','<p>TThe act of finding an object.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/SearchAction\">SearchAction</a>: FindAction is generally lead by a SearchAction, but not necessarily.</li>\n</ul>\n'),
	(469,3,14,X'416374696F6E53746174757354797065','ActionStatusType','The status of an Action.'),
	(470,3,14,X'4D6F6E6574617279416D6F756E74','MonetaryAmount','A monetary value or range. This type can be used to describe an amount of money such as $50 USD, or a range as in describing a bank account being suitable for a balance between £1,000 and £1,000,000 GBP, or the value of a salary, etc. It is recommended to use <a class=\"localLink\" href=\"http://schema.org/PriceSpecification\">PriceSpecification</a> Types to describe the price of an Offer, Invoice, etc.'),
	(471,3,14,X'44656D616E64','Demand','A demand entity represents the public, not necessarily binding, not necessarily exclusive, announcement by an organization or person to seek a certain type of goods or services. For describing demand using this type, the very same properties used for Offer apply.'),
	(472,3,14,X'426C6F67506F7374696E67','BlogPosting','A blog post.'),
	(473,3,14,X'47616D65','Game','The Game type represents things which are games. These are typically rule-governed recreational activities, e.g. role-playing games in which players assume the role of characters in a fictional setting.'),
	(474,3,14,X'5456536561736F6E','TVSeason','Season dedicated to TV broadcast and associated online delivery.'),
	(475,3,14,X'4372656174697665576F726B536572696573','CreativeWorkSeries','A CreativeWorkSeries in schema.org is a group of related items, typically but not necessarily of the same kind. CreativeWorkSeries are usually organized into some order, often chronological. Unlike <a class=\"localLink\" href=\"http://schema.org/ItemList\">ItemList</a> which is a general purpose data structure for lists of things, the emphasis with CreativeWorkSeries is on published materials (written e.g. books and periodicals, or media such as tv, radio and games).</p>\n\n<p>Specific subtypes are available for describing <a class=\"localLink\" href=\"http://schema.org/TVSeries\">TVSeries</a>, <a class=\"localLink\" href=\"http://schema.org/RadioSeries\">RadioSeries</a>, <a class=\"localLink\" href=\"http://schema.org/MovieSeries\">MovieSeries</a>, <a class=\"localLink\" href=\"http://schema.org/BookSeries\">BookSeries</a>, <a class=\"localLink\" href=\"http://schema.org/Periodical\">Periodical</a> and <a class=\"localLink\" href=\"http://schema.org/VideoGameSeries\">VideoGameSeries</a>. In each case, the <a class=\"localLink\" href=\"http://schema.org/hasPart\">hasPart</a> / <a class=\"localLink\" href=\"http://schema.org/isPartOf\">isPartOf</a> properties can be used to relate the CreativeWorkSeries to its parts. The general CreativeWorkSeries type serves largely just to organize these more specific and practical subtypes.</p>\n\n<p>It is common for properties applicable to an item from the series to be usefully applied to the containing group. Schema.org attempts to anticipate some of these cases, but publishers should be free to apply properties of the series parts to the series as a whole wherever they seem appropriate.'),
	(476,3,14,X'42726561646372756D624C697374','BreadcrumbList','A BreadcrumbList is an ItemList consisting of a chain of linked Web pages, typically described using at least their URL and their name, and typically ending with the current page.</p>\n\n<p>The <a class=\"localLink\" href=\"http://schema.org/position\">position</a> property is used to reconstruct the order of the items in a BreadcrumbList The convention is that a breadcrumb list has an <a class=\"localLink\" href=\"http://schema.org/itemListOrder\">itemListOrder</a> of <a class=\"localLink\" href=\"http://schema.org/ItemListOrderAscending\">ItemListOrderAscending</a> (lower values listed first), and that the first items in this list correspond to the \"top\" or beginning of the breadcrumb trail, e.g. with a site or section homepage. The specific values of \'position\' are not assigned meaning for a BreadcrumbList, but they should be integers, e.g. beginning with \'1\' for the first item in the list.'),
	(477,3,14,X'42726F6164636173744368616E6E656C','BroadcastChannel','A unique instance of a BroadcastService on a CableOrSatelliteService lineup.'),
	(478,3,14,X'4D7573696352656C65617365466F726D617454797065','MusicReleaseFormatType','Format of this release (the type of recording media used, ie. compact disc, digital media, LP, etc.).'),
	(479,3,14,X'52657475726E416374696F6E','ReturnAction','The act of returning to the origin that which was previously received (concrete objects) or taken (ownership).'),
	(480,3,14,X'547261636B416374696F6E','TrackAction','<p>An agent tracks an object for updates.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/FollowAction\">FollowAction</a>: Unlike FollowAction, TrackAction refers to the interest on the location of innanimates objects.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/SubscribeAction\">SubscribeAction</a>: Unlike SubscribeAction, TrackAction refers to  the interest on the location of innanimate objects.</li>\n</ul>\n'),
	(481,3,14,X'4461794F665765656B','DayOfWeek','The day of the week, e.g. used to specify to which day the opening hours of an OpeningHoursSpecification refer.</p>\n\n<p>Originally, URLs from <a href=\"http://purl.org/goodrelations/v1\">GoodRelations</a> were used (for <a class=\"localLink\" href=\"http://schema.org/Monday\">Monday</a>, <a class=\"localLink\" href=\"http://schema.org/Tuesday\">Tuesday</a>, <a class=\"localLink\" href=\"http://schema.org/Wednesday\">Wednesday</a>, <a class=\"localLink\" href=\"http://schema.org/Thursday\">Thursday</a>, <a class=\"localLink\" href=\"http://schema.org/Friday\">Friday</a>, <a class=\"localLink\" href=\"http://schema.org/Saturday\">Saturday</a>, <a class=\"localLink\" href=\"http://schema.org/Sunday\">Sunday</a> plus a special entry for <a class=\"localLink\" href=\"http://schema.org/PublicHolidays\">PublicHolidays</a>); these have now been integrated directly into schema.org.'),
	(482,3,14,X'496E746572616374416374696F6E','InteractAction','The act of interacting with another person or organization.'),
	(483,3,14,X'4D75736963416C62756D50726F64756374696F6E54797065','MusicAlbumProductionType','Classification of the album by it\'s type of content: soundtrack, live album, studio album, etc.'),
	(484,3,14,X'436F6E74616374506F696E744F7074696F6E','ContactPointOption','Enumerated options related to a ContactPoint.'),
	(485,3,14,X'4D6F766965','Movie','A movie.'),
	(486,3,14,X'4D75736963436F6D706F736974696F6E','MusicComposition','A musical composition.'),
	(487,3,14,X'496E766573746D656E744F724465706F736974','InvestmentOrDeposit','A type of financial product that typically requires the client to transfer funds to a financial service in return for potential beneficial financial return.'),
	(488,3,14,X'426F6F6C65616E','Boolean','Boolean: True or False.'),
	(489,3,14,X'4472697665576865656C436F6E66696775726174696F6E56616C7565','DriveWheelConfigurationValue','A value indicating which roadwheels will receive torque.'),
	(490,3,14,X'5075626C69636174696F6E4576656E74','PublicationEvent','A PublicationEvent corresponds indifferently to the event of publication for a CreativeWork of any type e.g. a broadcast event, an on-demand event, a book/journal publication via a variety of delivery media.'),
	(491,3,14,X'496E646976696475616C50726F64756374','IndividualProduct','A single, identifiable product instance (e.g. a laptop with a particular serial number).'),
	(492,3,14,X'4F7267616E697A65416374696F6E','OrganizeAction','The act of manipulating/administering/supervising/controlling one or more objects.'),
	(493,3,14,X'417373657373416374696F6E','AssessAction','The act of forming one\'s opinion, reaction or sentiment.'),
	(494,3,14,X'50726F64756374','Product','Any offered product or service. For example: a pair of shoes; a concert ticket; the rental of a car; a haircut; or an episode of a TV show streamed online.'),
	(495,3,14,X'52737670526573706F6E736554797065','RsvpResponseType','RsvpResponseType is an enumeration type whose instances represent responding to an RSVP request.'),
	(496,3,14,X'4E7574726974696F6E496E666F726D6174696F6E','NutritionInformation','Nutritional information about the recipe.'),
	(497,3,14,X'417564696F4F626A656374','AudioObject','An audio file.'),
	(498,3,14,X'42757354726970','BusTrip','A trip on a commercial bus line.'),
	(499,3,14,X'52656365697665416374696F6E','ReceiveAction','<p>The act of physically/electronically taking delivery of an object thathas been transferred from an origin to a destination. Reciprocal of SendAction.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/SendAction\">SendAction</a>: The reciprocal of ReceiveAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/TakeAction\">TakeAction</a>: Unlike TakeAction, ReceiveAction does not imply that the ownership has been transfered (e.g. I can receive a package, but it does not mean the package is now mine).</li>\n</ul>\n'),
	(500,3,14,X'42616E6B4163636F756E74','BankAccount','A product or service offered by a bank whereby one may deposit, withdraw or transfer money and in some cases be paid interest.'),
	(501,3,14,X'526F6F6D','Room','A room is a distinguishable space within a structure, usually separated from other spaces by interior walls. (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Room\">http://en.wikipedia.org/wiki/Room</a>).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),
	(502,3,14,X'436F6D70757465724C616E6775616765','ComputerLanguage','This type covers computer programming languages such as Scheme and Lisp, as well as other language-like computer representations. Natural languages are best represented with the <a class=\"localLink\" href=\"http://schema.org/Language\">Language</a> type.'),
	(503,3,14,X'42726F61646361737453657276696365','BroadcastService','A delivery service through which content is provided via broadcast over the air or online.'),
	(504,3,14,X'4D75736963506C61796C697374','MusicPlaylist','A collection of music tracks in playlist form.'),
	(505,3,14,X'536572766963654368616E6E656C','ServiceChannel','A means for accessing a service, e.g. a government office location, web site, or phone number.'),
	(506,3,14,X'566964656F4F626A656374','VideoObject','A video file.'),
	(507,3,14,X'416C6C6F63617465416374696F6E','AllocateAction','The act of organizing tasks/objects/events by associating resources to it.'),
	(508,3,14,X'416767726567617465526174696E67','AggregateRating','The average rating based on multiple ratings or reviews.'),
	(509,3,14,X'41727469636C65','Article','An article, such as a news article or piece of investigative report. Newspapers and magazines have articles of many different types and this is intended to cover them all.</p>\n\n<p>See also <a href=\"http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html\">blog post</a>.'),
	(510,3,14,X'546970416374696F6E','TipAction','The act of giving money voluntarily to a beneficiary in recognition of services rendered.'),
	(511,3,14,X'506572666F726D696E6747726F7570','PerformingGroup','A performance group, such as a band, an orchestra, or a circus.'),
	(512,3,14,X'5461786953657276696365','TaxiService','A service for a vehicle for hire with a driver for local travel. Fares are usually calculated based on distance traveled.'),
	(513,3,14,X'436F6D6D656E74','Comment','A comment on an item - for example, a comment on a blog post. The comment\'s content is expressed via the <a class=\"localLink\" href=\"http://schema.org/text\">text</a> property, and its topic via <a class=\"localLink\" href=\"http://schema.org/about\">about</a>, properties shared with all CreativeWorks.'),
	(514,3,14,X'4372656174697665576F726B','CreativeWork','The most generic kind of creative work, including books, movies, photographs, software programs, etc.'),
	(515,3,14,X'53637265656E696E674576656E74','ScreeningEvent','A screening of a movie or other video.'),
	(516,3,14,X'4D6F7665416374696F6E','MoveAction','<p>The act of an agent relocating to a place.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/TransferAction\">TransferAction</a>: Unlike TransferAction, the subject of the move is a living Person or Organization rather than an inanimate object.</li>\n</ul>\n'),
	(517,3,14,X'536F6D6550726F6475637473','SomeProducts','A placeholder for multiple similar products of the same kind.'),
	(518,3,14,X'426F6F6B466F726D617454797065','BookFormatType','The publication format of the book.'),
	(519,3,14,X'57617272616E747950726F6D697365','WarrantyPromise','A structured value representing the duration and scope of services that will be provided to a customer free of charge in case of a defect or malfunction of a product.'),
	(520,3,14,X'506172656E7441756469656E6365','ParentAudience','A set of characteristics describing parents, who can be interested in viewing some content.'),
	(521,3,14,X'456E646F727365416374696F6E','EndorseAction','An agent approves/certifies/likes/supports/sanction an object.'),
	(522,3,14,X'44617461736574','Dataset','A body of structured information describing some topic(s) of interest.'),
	(523,3,14,X'44617461436174616C6F67','DataCatalog','A collection of datasets.'),
	(524,3,14,X'42726F6164636173744576656E74','BroadcastEvent','An over the air or online broadcast event.'),
	(525,3,14,X'526576696577','Review','A review of an item - for example, of a restaurant, movie, or store.'),
	(526,3,14,X'436F72706F726174696F6E','Corporation','Organization: A business corporation.'),
	(527,3,14,X'5175616C6974617469766556616C7565','QualitativeValue','A predefined value for a product characteristic, e.g. the power cord plug type \'US\' or the garment sizes \'S\', \'M\', \'L\', and \'XL\'.'),
	(528,3,14,X'547261696E53746174696F6E','TrainStation','A train station.'),
	(529,3,14,X'54696D65','Time','A point in time recurring on multiple days in the form hh:mm:ss[Z|(+|-)hh:mm] (see <a href=\"http://www.w3.org/TR/xmlschema-2/#time\">XML schema for details</a>).'),
	(530,3,14,X'41646D696E69737472617469766541726561','AdministrativeArea','A geographical region, typically under the jurisdiction of a particular government.'),
	(531,3,14,X'4A6F696E416374696F6E','JoinAction','<p>An agent joins an event/group with participants/friends at a location.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/RegisterAction\">RegisterAction</a>: Unlike RegisterAction, JoinAction refers to joining a group/team of people.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/SubscribeAction\">SubscribeAction</a>: Unlike SubscribeAction, JoinAction does not imply that you\'ll be receiving updates.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/FollowAction\">FollowAction</a>: Unlike FollowAction, JoinAction does not imply that you\'ll be polling for updates.</li>\n</ul>\n'),
	(532,3,14,X'486F74656C526F6F6D','HotelRoom','A hotel room is a single room in a hotel.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),
	(533,3,14,X'5265616374416374696F6E','ReactAction','The act of responding instinctively and emotionally to an object, expressing a sentiment.'),
	(534,3,14,X'4163636F6D6D6F646174696F6E','Accommodation','An accommodation is a place that can accommodate human beings, e.g. a hotel room, a camping pitch, or a meeting room. Many accommodations are for overnight stays, but this is not a mandatory requirement.\nFor more specific types of accommodations not defined in schema.org, one can use additionalType with external vocabularies.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),
	(535,3,14,X'4F72646572','Order','An order is a confirmation of a transaction (a receipt), which can contain multiple line items, each represented by an Offer that has been accepted by the customer.'),
	(536,3,14,X'4D757369635265636F7264696E67','MusicRecording','A music recording (track), usually a single song.'),
	(537,3,14,X'476F7665726E6D656E7453657276696365','GovernmentService','A service provided by a government organization, e.g. food stamps, veterans benefits, etc.'),
	(538,3,14,X'426F72726F77416374696F6E','BorrowAction','<p>The act of obtaining an object under an agreement to return it at a later date. Reciprocal of LendAction.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/LendAction\">LendAction</a>: Reciprocal of BorrowAction.</li>\n</ul>\n'),
	(539,3,14,X'416464416374696F6E','AddAction','The act of editing by adding an object to a collection.'),
	(540,3,14,X'53706F7274734576656E74','SportsEvent','Event type: Sports event.'),
	(541,3,14,X'4167677265676174654F66666572','AggregateOffer','When a single product is associated with multiple offers (for example, the same pair of shoes is offered by different merchants), then AggregateOffer can be used.'),
	(542,3,14,X'4C6F6467696E675265736572766174696F6E','LodgingReservation','A reservation for lodging at a hotel, motel, inn, etc.</p>\n\n<p>Note: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations.'),
	(543,3,14,X'4E65777341727469636C65','NewsArticle','A news article.'),
	(544,3,14,X'5772697465416374696F6E','WriteAction','The act of authoring written creative content.'),
	(545,3,14,X'436F6E74726F6C416374696F6E','ControlAction','An agent controls a device or application.'),
	(546,3,14,X'496E73657274416374696F6E','InsertAction','The act of adding at a specific location in an ordered collection.'),
	(547,3,14,X'436F6E73756D65416374696F6E','ConsumeAction','The act of ingesting information/resources/food.'),
	(548,3,14,X'47656F436972636C65','GeoCircle','A GeoCircle is a GeoShape representing a circular geographic area. As it is a GeoShape\n          it provides the simple textual property \'circle\', but also allows the combination of postalCode alongside geoRadius.\n          The center of the circle can be indicated via the \'geoMidpoint\' property, or more approximately using \'address\', \'postalCode\'.'),
	(549,3,14,X'466F6C6C6F77416374696F6E','FollowAction','<p>The act of forming a personal connection with someone/something (object) unidirectionally/asymmetrically to get updates polled from.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/BefriendAction\">BefriendAction</a>: Unlike BefriendAction, FollowAction implies that the connection is <em>not</em> necessarily reciprocal.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/SubscribeAction\">SubscribeAction</a>: Unlike SubscribeAction, FollowAction implies that the follower acts as an active agent constantly/actively polling for updates.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/RegisterAction\">RegisterAction</a>: Unlike RegisterAction, FollowAction implies that the agent is interested in continuing receiving updates from the object.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/JoinAction\">JoinAction</a>: Unlike JoinAction, FollowAction implies that the agent is interested in getting updates from the object.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/TrackAction\">TrackAction</a>: Unlike TrackAction, FollowAction refers to the polling of updates of all aspects of animate objects rather than the location of inanimate objects (e.g. you track a package, but you don\'t follow it).</li>\n</ul>\n'),
	(550,3,14,X'53656C6C416374696F6E','SellAction','The act of taking money from a buyer in exchange for goods or services rendered. An agent sells an object, product, or service to a buyer for a price. Reciprocal of BuyAction.'),
	(551,3,14,X'526563697065','Recipe','A recipe. For dietary restrictions covered by the recipe, a few common restrictions are enumerated via <a class=\"localLink\" href=\"http://schema.org/suitableForDiet\">suitableForDiet</a>. The <a class=\"localLink\" href=\"http://schema.org/keywords\">keywords</a> property can also be used to add more detail.'),
	(552,3,14,X'4C6F7365416374696F6E','LoseAction','The act of being defeated in a competitive activity.'),
	(553,3,14,X'42757353746F70','BusStop','A bus stop.'),
	(554,3,14,X'526164696F536572696573','RadioSeries','CreativeWorkSeries dedicated to radio broadcast and associated online delivery.'),
	(555,3,14,X'53706F72747341637469766974794C6F636174696F6E','SportsActivityLocation','A sports location, such as a playing field.'),
	(556,3,14,X'436F6E74616374506F696E74','ContactPoint','A contact point&#x2014;for example, a Customer Complaints department.'),
	(557,3,14,X'4D75736963416C62756D52656C6561736554797065','MusicAlbumReleaseType','The kind of release which this album is: single, EP or album.'),
	(558,3,14,X'476F7665726E6D656E744275696C64696E67','GovernmentBuilding','A government building.'),
	(559,3,14,X'506572696F646963616C','Periodical','A publication in any medium issued in successive parts bearing numerical or chronological designations and intended, such as a magazine, scholarly journal, or newspaper to continue indefinitely.</p>\n\n<p>See also <a href=\"http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html\">blog post</a>.'),
	(560,3,14,X'42757353746174696F6E','BusStation','A bus station.'),
	(561,3,14,X'426F64794F665761746572','BodyOfWater','A body of water, such as a sea, ocean, or lake.'),
	(562,3,14,X'4469676974616C446F63756D656E74','DigitalDocument','An electronic file or document.'),
	(563,3,14,X'427573696E65737341756469656E6365','BusinessAudience','A set of characteristics belonging to businesses, e.g. who compose an item\'s target audience.'),
	(564,3,14,X'536561726368416374696F6E','SearchAction','<p>The act of searching for an object.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/FindAction\">FindAction</a>: SearchAction generally leads to a FindAction, but not necessarily.</li>\n</ul>\n'),
	(565,3,14,X'4D6170','Map','A map.'),
	(566,3,14,X'506C6179416374696F6E','PlayAction','<p>The act of playing/exercising/training/performing for enjoyment, leisure, recreation, Competition or exercise.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/ListenAction\">ListenAction</a>: Unlike ListenAction (which is under ConsumeAction), PlayAction refers to performing for an audience or at an event, rather than consuming music.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/WatchAction\">WatchAction</a>: Unlike WatchAction (which is under ConsumeAction), PlayAction refers to showing/displaying for an audience or at an event, rather than consuming visual content.</li>\n</ul>\n'),
	(567,3,14,X'446F6E617465416374696F6E','DonateAction','The act of providing goods, services, or money without compensation, often for philanthropic reasons.'),
	(568,3,14,X'44617461446F776E6C6F6164','DataDownload','A dataset in downloadable form.'),
	(569,3,14,X'50656F706C6541756469656E6365','PeopleAudience','A set of characteristics belonging to people, e.g. who compose an item\'s target audience.'),
	(570,3,14,X'436F756E747279','Country','A country.'),
	(571,3,14,X'4A6F62506F7374696E67','JobPosting','A listing that describes a job opening in a certain organization.'),
	(572,3,14,X'5456536572696573','TVSeries','CreativeWorkSeries dedicated to TV broadcast and associated online delivery.'),
	(573,3,14,X'55524C','URL','Data type: URL.'),
	(574,3,14,X'417574686F72697A65416374696F6E','AuthorizeAction','The act of granting permission to an object.'),
	(575,3,14,X'5175616E746974617469766556616C7565','QuantitativeValue','A point value or interval for product characteristics and other purposes.'),
	(576,3,14,X'5374727563747572656456616C7565','StructuredValue','Structured values are used when the value of a property has a more complex structure than simply being a textual value or a reference to another thing.'),
	(577,3,14,X'5265706C79416374696F6E','ReplyAction','<p>The act of responding to a question/message asked/sent by the object. Related to <a class=\"localLink\" href=\"http://schema.org/AskAction\">AskAction</a></p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/AskAction\">AskAction</a>: Appears generally as an origin of a ReplyAction.</li>\n</ul>\n'),
	(578,3,14,X'4F666665724974656D436F6E646974696F6E','OfferItemCondition','A list of possible conditions for the item.'),
	(579,3,14,X'57656250616765456C656D656E74','WebPageElement','A web page element, like a table or an image.'),
	(580,3,14,X'4D657373616765','Message','A single message from a sender to one or more organizations or people.'),
	(581,3,14,X'54797065416E645175616E746974794E6F6465','TypeAndQuantityNode','A structured value indicating the quantity, unit of measurement, and business function of goods included in a bundle offer.'),
	(582,3,14,X'547261696E54726970','TrainTrip','A trip on a commercial train line.'),
	(583,3,14,X'4361626C654F72536174656C6C69746553657276696365','CableOrSatelliteService','A service which provides access to media programming like TV or radio. Access may be via cable or satellite.'),
	(584,3,14,X'53657276696365','Service','A service provided by an organization, e.g. delivery service, print services, etc.'),
	(585,3,14,X'50617263656C44656C6976657279','ParcelDelivery','The delivery of a parcel either via the postal service or a commercial service.'),
	(586,3,14,X'5075626C69636174696F6E566F6C756D65','PublicationVolume','<p>A part of a successively published publication such as a periodical or multi-volume work, often numbered. It may represent a time span, such as a year.</p>\n\n<pre><code>  &lt;br/&gt;&lt;br/&gt;See also &lt;a href=\"http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html\"&gt;blog post&lt;/a&gt;.\n</code></pre>\n'),
	(587,3,14,X'53696E676C6546616D696C795265736964656E6365','SingleFamilyResidence','Residence type: Single-family home.'),
	(588,3,14,X'4C6567616C53657276696365','LegalService','A LegalService is a business that provides legally-oriented services, advice and representation, e.g. law firms.</p>\n\n<p>As a <a class=\"localLink\" href=\"http://schema.org/LocalBusiness\">LocalBusiness</a> it can be described as a <a class=\"localLink\" href=\"http://schema.org/provider\">provider</a> of one or more <a class=\"localLink\" href=\"http://schema.org/Service\">Service</a>(s).'),
	(589,3,14,X'496E74616E6769626C65','Intangible','A utility class that serves as the umbrella for a number of \'intangible\' things such as quantities, structured values, etc.'),
	(590,3,14,X'566F7465416374696F6E','VoteAction','The act of expressing a preference from a fixed/finite/structured set of choices/options.'),
	(591,3,14,X'4F7267616E697A6174696F6E526F6C65','OrganizationRole','A subclass of Role used to describe roles within organizations.'),
	(592,3,14,X'456E756D65726174696F6E','Enumeration','Lists or enumerations—for example, a list of cuisines or music genres, etc.'),
	(593,3,14,X'44617465','Date','A date value in <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601 date format</a>.'),
	(594,3,14,X'476F7665726E6D656E744F6666696365','GovernmentOffice','A government office&#x2014;for example, an IRS or DMV office.'),
	(595,3,14,X'44617461466565644974656D','DataFeedItem','A single item within a larger data feed.'),
	(596,3,14,X'4D7573696347726F7570','MusicGroup','A musical group, such as a band, an orchestra, or a choir. Can also be a solo musician.'),
	(597,3,14,X'4461746554696D65','DateTime','A combination of date and time of day in the form [-]CCYY-MM-DDThh:mm:ss[Z|(+|-)hh:mm] (see Chapter 5.4 of ISO 8601).'),
	(598,3,14,X'526F6C65','Role','Represents additional information about a relationship or property. For example a Role can be used to say that a \'member\' role linking some SportsTeam to a player occurred during a particular time period. Or that a Person\'s \'actor\' role in a Movie was for some particular characterName. Such properties can be attached to a Role entity, which is then associated with the main entities using ordinary properties like \'member\' or \'actor\'.</p>\n\n<p>See also <a href=\"http://blog.schema.org/2014/06/introducing-role.html\">blog post</a>.'),
	(599,3,14,X'4974656D4C697374','ItemList','A list of items of any sort&#x2014;for example, Top 10 Movies About Weathermen, or Top 100 Party Songs. Not to be confused with HTML lists, which are often used only for formatting.'),
	(600,3,14,X'436F6D706F756E64507269636553706563696669636174696F6E','CompoundPriceSpecification','A compound price specification is one that bundles multiple prices that all apply in combination for different dimensions of consumption. Use the name property of the attached unit price specification for indicating the dimension of a price component (e.g. \"electricity\" or \"final cleaning\").'),
	(601,3,14,X'427573696E657373456E7469747954797065','BusinessEntityType','<p>A business entity type is a conceptual entity representing the legal form, the size, the main line of business, the position in the value chain, or any combination thereof, of an organization or business person.</p>\n\n<p>Commonly used values:</p>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#Business</li>\n<li>http://purl.org/goodrelations/v1#Enduser</li>\n<li>http://purl.org/goodrelations/v1#PublicInstitution</li>\n<li>http://purl.org/goodrelations/v1#Reseller</li>\n</ul>\n'),
	(602,3,14,X'416374696F6E','Action','An action performed by a direct agent and indirect participants upon a direct object. Optionally happens at a location with the help of an inanimate instrument. The execution of the action may produce a result. Specific action sub-type documentation specifies the exact expectation of each argument/role.</p>\n\n<p>See also <a href=\"http://blog.schema.org/2014/04/announcing-schemaorg-actions.html\">blog post</a> and <a href=\"http://schema.org/docs/actions.html\">Actions overview document</a>.'),
	(603,3,14,X'4C697665426C6F67506F7374696E67','LiveBlogPosting','A blog post intended to provide a rolling textual coverage of an ongoing event through continuous updates.'),
	(604,3,14,X'57656253697465','WebSite','A WebSite is a set of related web pages and other items typically served from a single web domain and accessible via URLs.'),
	(605,3,14,X'5456436C6970','TVClip','A short TV program or a segment/part of a TV program.'),
	(606,3,14,X'41756469656E6365','Audience','Intended audience for an item, i.e. the group for whom the item was created.'),
	(607,3,14,X'436F6D6D756E6963617465416374696F6E','CommunicateAction','The act of conveying information to another person via a communication medium (instrument) such as speech, email, or telephone conversation.'),
	(608,3,14,X'5472616465416374696F6E','TradeAction','The act of participating in an exchange of goods and services for monetary compensation. An agent trades an object, product or service with a participant in exchange for a one time or periodic payment.'),
	(609,3,14,X'47616D65536572766572537461747573','GameServerStatus','Status of a game server.'),
	(610,3,14,X'456D657267656E637953657276696365','EmergencyService','An emergency service, such as a fire station or ER.'),
	(611,3,14,X'5465636841727469636C65','TechArticle','A technical article - Example: How-to (task) topics, step-by-step, procedural troubleshooting, specifications, etc.'),
	(612,3,14,X'4272616E64','Brand','A brand is a name used by an organization or business person for labeling a product, product group, or similar.'),
	(613,3,14,X'44656C697665727943686172676553706563696669636174696F6E','DeliveryChargeSpecification','The price for the delivery of an offer using a particular delivery method.'),
	(614,3,14,X'496E766F696365','Invoice','A statement of the money due for goods or services; a bill.'),
	(615,3,14,X'507269636553706563696669636174696F6E','PriceSpecification','A structured value representing a price or price range. Typically, only the subclasses of this type are used for markup. It is recommended to use <a class=\"localLink\" href=\"http://schema.org/MonetaryAmount\">MonetaryAmount</a> to describe independent amounts of money such as a salary, credit card limits, etc.'),
	(616,3,14,X'46696E616E6369616C53657276696365','FinancialService','Financial services business.'),
	(617,3,14,X'4369766963537472756374757265','CivicStructure','A public structure, such as a town hall or concert hall.'),
	(618,3,14,X'56697375616C417274776F726B','VisualArtwork','A work of art that is primarily visual in character.'),
	(619,3,14,X'456475636174696F6E616C4F7267616E697A6174696F6E','EducationalOrganization','An educational organization.'),
	(620,3,14,X'5265736964656E6365','Residence','The place where a person lives.'),
	(621,3,14,X'4175746F6D6F74697665427573696E657373','AutomotiveBusiness','Car repair, sales, or parts.'),
	(622,3,14,X'5265737472696374656444696574','RestrictedDiet','A diet restricted to certain foods or preparations for cultural, religious, health or lifestyle reasons.'),
	(623,3,14,X'4D65646963616C4F7267616E697A6174696F6E','MedicalOrganization','A medical organization (physical or not), such as hospital, institution or clinic.'),
	(624,3,14,X'47656F5368617065','GeoShape','The geographic shape of a place. A GeoShape can be described using several properties whose values are based on latitude/longitude pairs. Either whitespace or commas can be used to separate latitude and longitude; whitespace should be used when writing a list of several such points.'),
	(625,3,14,X'47656F436F6F7264696E61746573','GeoCoordinates','The geographic coordinates of a place or event.'),
	(626,3,14,X'5472616E73666572416374696F6E','TransferAction','The act of transferring/moving (abstract or concrete) animate or inanimate objects from one place to another.'),
	(627,3,14,X'526174696E67','Rating','A rating is an evaluation on a numeric scale, such as 1 to 5 stars.'),
	(628,3,14,X'416C69676E6D656E744F626A656374','AlignmentObject','An intangible item that describes an alignment between a learning resource and a node in an educational framework.'),
	(629,3,14,X'5265736572766174696F6E','Reservation','Describes a reservation for travel, dining or an event. Some reservations require tickets. </p>\n\n<p>Note: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, restaurant reservations, flights, or rental cars, use <a class=\"localLink\" href=\"http://schema.org/Offer\">Offer</a>.'),
	(630,3,14,X'4469676974616C446F63756D656E745065726D697373696F6E54797065','DigitalDocumentPermissionType','A type of permission which can be granted for accessing a digital document.'),
	(631,3,14,X'5065726D6974','Permit','A permit issued by an organization, e.g. a parking pass.'),
	(632,3,14,X'46696E616E6369616C50726F64756374','FinancialProduct','A product provided to consumers and businesses by financial institutions such as banks, insurance companies, brokerage firms, consumer finance companies, and investment companies which comprise the financial services industry.'),
	(633,3,14,X'5468696E67','Thing','The most generic type of item.'),
	(634,3,14,X'5456457069736F6465','TVEpisode','A TV episode which can be part of a series or season.'),
	(635,3,14,X'42656444657461696C73','BedDetails','An entity holding detailed information about the available bed types, e.g. the quantity of twin beds for a hotel room. For the single case of just one bed of a certain type, you can use bed directly with a text. See also <a class=\"localLink\" href=\"http://schema.org/BedType\">BedType</a> (under development).'),
	(636,3,14,X'4D7573696352656C65617365','MusicRelease','A MusicRelease is a specific release of a music album.'),
	(637,3,14,X'4C65617665416374696F6E','LeaveAction','<p>An agent leaves an event / group with participants/friends at a location.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/JoinAction\">JoinAction</a>: The antonym of LeaveAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/UnRegisterAction\">UnRegisterAction</a>: Unlike UnRegisterAction, LeaveAction implies leaving a group/team of people rather than a service.</li>\n</ul>\n'),
	(638,3,14,X'4372656174697665576F726B536561736F6E','CreativeWorkSeason','A media season e.g. tv, radio, video game etc.'),
	(639,3,14,X'5370656369616C7479','Specialty','Any branch of a field in which people typically develop specific expertise, usually after significant study, time, and effort.'),
	(640,3,14,X'4C6F616E4F72437265646974','LoanOrCredit','A financial product for the loaning of an amount of money under agreed terms and charges.'),
	(641,3,14,X'53656E64416374696F6E','SendAction','<p>The act of physically/electronically dispatching an object for transfer from an origin to a destination.Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/ReceiveAction\">ReceiveAction</a>: The reciprocal of SendAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/GiveAction\">GiveAction</a>: Unlike GiveAction, SendAction does not imply the transfer of ownership (e.g. I can send you my laptop, but I\'m not necessarily giving it to you).</li>\n</ul>\n'),
	(642,3,14,X'426F617264696E67506F6C69637954797065','BoardingPolicyType','A type of boarding policy used by an airline.'),
	(643,3,14,X'456E7465727461696E6D656E74427573696E657373','EntertainmentBusiness','A business providing entertainment.'),
	(644,3,14,X'4C616E6775616765','Language','Natural languages such as Spanish, Tamil, Hindi, English, etc. Formal language code tags expressed in <a href=\"https://en.wikipedia.org/wiki/IETF_language_tag\">BCP 47</a> can be used via the <a class=\"localLink\" href=\"http://schema.org/alternateName\">alternateName</a> property. The Language type previously also covered programming languages such as Scheme and Lisp, which are now best represented using <a class=\"localLink\" href=\"http://schema.org/ComputerLanguage\">ComputerLanguage</a>.'),
	(645,3,14,X'536F6674776172654170706C69636174696F6E','SoftwareApplication','A software application.'),
	(646,3,14,X'466C69676874','Flight','An airline flight.'),
	(647,3,14,X'426F6F6B','Book','A book.'),
	(648,3,14,X'4D617043617465676F727954797065','MapCategoryType','An enumeration of several kinds of Map.'),
	(649,3,14,X'436F75727365496E7374616E6365','CourseInstance','An instance of a <a class=\"localLink\" href=\"http://schema.org/Course\">Course</a> which is distinct from other instances because it is offered at a different time or location or through different media or modes of study or to a specific section of students.'),
	(650,3,14,X'4F726465724974656D','OrderItem','An order item is a line of an order. It includes the quantity and shipping details of a bought offer.'),
	(651,3,14,X'50726F6772616D4D656D62657273686970','ProgramMembership','Used to describe membership in a loyalty programs (e.g. \"StarAliance\"), traveler clubs (e.g. \"AAA\"), purchase clubs (\"Safeway Club\"), etc.'),
	(652,3,14,X'456E65726779','Energy','Properties that take Energy as values are of the form \'&lt;Number&gt; &lt;Energy unit of measure&gt;\'.'),
	(653,3,14,X'47616D65536572766572','GameServer','Server that provides game interaction in a multiplayer game.'),
	(654,3,14,X'5374656572696E67506F736974696F6E56616C7565','SteeringPositionValue','A value indicating a steering position.'),
	(655,3,14,X'4D6F766965536572696573','MovieSeries','A series of movies. Included movies can be indicated with the hasPart property.'),
	(656,3,14,X'4461746154797065','DataType','The basic data types such as Integers, Strings, etc.'),
	(657,3,14,X'44656C69766572794D6574686F64','DeliveryMethod','<p>A delivery method is a standardized procedure for transferring the product or service to the destination of fulfillment chosen by the customer. Delivery methods are characterized by the means of transportation used, and by the organization or group that is the contracting party for the sending organization or person.</p>\n\n<p>Commonly used values:</p>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#DeliveryModeDirectDownload</li>\n<li>http://purl.org/goodrelations/v1#DeliveryModeFreight</li>\n<li>http://purl.org/goodrelations/v1#DeliveryModeMail</li>\n<li>http://purl.org/goodrelations/v1#DeliveryModeOwnFleet</li>\n<li>http://purl.org/goodrelations/v1#DeliveryModePickUp</li>\n<li>http://purl.org/goodrelations/v1#DHL</li>\n<li>http://purl.org/goodrelations/v1#FederalExpress</li>\n<li>http://purl.org/goodrelations/v1#UPS</li>\n</ul>\n'),
	(658,3,14,X'466F6F6445737461626C6973686D656E745265736572766174696F6E','FoodEstablishmentReservation','A reservation to dine at a food-related business.Note: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations.'),
	(659,3,14,X'4F72646572537461747573','OrderStatus','Enumerated status values for Order.'),
	(660,3,14,X'5469636B6574','Ticket','Used to describe a ticket to an event, a flight, a bus ride, etc.'),
	(661,3,14,X'57656250616765','WebPage','A web page. Every web page is implicitly assumed to be declared to be of type WebPage, so the various properties about that webpage, such as <code>breadcrumb</code> may be used. We recommend explicit declaration if these properties are specified, but if they are found outside of an itemscope, they will be assumed to be about the page.'),
	(662,3,14,X'4C616E64666F726D','Landform','A landform or physical feature.  Landform elements include mountains, plains, lakes, rivers, seascape and oceanic waterbody interface features such as bays, peninsulas, seas and so forth, including sub-aqueous terrain features such as submersed mountain ranges, volcanoes, and the great ocean basins.'),
	(663,3,14,X'436F6D6D656E74416374696F6E','CommentAction','The act of generating a comment about a subject.'),
	(664,3,14,X'466F6F6445737461626C6973686D656E74','FoodEstablishment','A food-related business.'),
	(665,3,14,X'5765624170706C69636174696F6E','WebApplication','Web applications.'),
	(666,3,14,X'50726F706572747956616C7565','PropertyValue','A property-value pair, e.g. representing a feature of a product or place. Use the \'name\' property for the name of the property. If there is an additional human-readable version of the value, put that into the \'description\' property.</p>\n\n<p>Always use specific schema.org properties when a) they exist and b) you can populate them. Using PropertyValue as a substitute will typically not trigger the same effect as using the original, specific property.'),
	(667,3,14,X'47656E64657254797065','GenderType','An enumeration of genders.'),
	(668,3,14,X'41736B416374696F6E','AskAction','<p>The act of posing a question / favor to someone.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/ReplyAction\">ReplyAction</a>: Appears generally as a response to AskAction.</li>\n</ul>\n'),
	(669,3,14,X'506C616E416374696F6E','PlanAction','The act of planning the execution of an event/task/action/reservation/plan to a future date.'),
	(670,3,14,X'5265736572766174696F6E53746174757354797065','ReservationStatusType','Enumerated status values for Reservation.'),
	(671,3,14,X'4F66666572436174616C6F67','OfferCatalog','An OfferCatalog is an ItemList that contains related Offers and/or further OfferCatalogs that are offeredBy the same provider.'),
	(672,3,14,X'427579416374696F6E','BuyAction','The act of giving money to a seller in exchange for goods or services rendered. An agent buys an object, product, or service from a seller for a price. Reciprocal of SellAction.'),
	(673,3,14,X'506C616365','Place','Entities that have a somewhat fixed, physical extension.'),
	(674,3,14,X'426C6F67','Blog','A blog.'),
	(675,3,14,X'506C6163654F66576F7273686970','PlaceOfWorship','Place of worship, such as a church, synagogue, or mosque.'),
	(676,3,14,X'4578657263697365416374696F6E','ExerciseAction','The act of participating in exertive activity for the purposes of improving health and fitness.'),
	(677,3,14,X'4576656E74','Event','An event happening at a certain time and location, such as a concert, lecture, or festival. Ticketing information may be added via the <a class=\"localLink\" href=\"http://schema.org/offers\">offers</a> property. Repeated events may be structured as separate Event objects.'),
	(678,3,14,X'5175616E74697479','Quantity','Quantities such as distance, time, mass, weight, etc. Particular instances of say Mass are entities like \'3 Kg\' or \'4 milligrams\'.'),
	(679,3,14,X'496E746572616374696F6E436F756E746572','InteractionCounter','A summary of how users have interacted with this CreativeWork. In most cases, authors will use a subtype to specify the specific type of interaction.'),
	(680,3,14,X'55736572436F6D6D656E7473','UserComments','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),
	(681,3,14,X'4150495265666572656E6365','APIReference','Reference documentation for application programming interfaces (APIs).'),
	(682,3,14,X'4974656D417661696C6162696C697479','ItemAvailability','A list of possible product availability options.'),
	(683,3,14,X'47616D65506C61794D6F6465','GamePlayMode','Indicates whether this game is multi-player, co-op or single-player.'),
	(684,3,14,X'52737670416374696F6E','RsvpAction','The act of notifying an event organizer as to whether you expect to attend the event.'),
	(685,3,14,X'486F6D65416E64436F6E737472756374696F6E427573696E657373','HomeAndConstructionBusiness','A construction business.</p>\n\n<p>A HomeAndConstructionBusiness is a <a class=\"localLink\" href=\"http://schema.org/LocalBusiness\">LocalBusiness</a> that provides services around homes and buildings.</p>\n\n<p>As a <a class=\"localLink\" href=\"http://schema.org/LocalBusiness\">LocalBusiness</a> it can be described as a <a class=\"localLink\" href=\"http://schema.org/provider\">provider</a> of one or more <a class=\"localLink\" href=\"http://schema.org/Service\">Service</a>(s).'),
	(686,3,14,X'436F6F6B416374696F6E','CookAction','The act of producing/preparing food.'),
	(687,3,14,X'5375697465','Suite','A suite in a hotel or other public accommodation, denotes a class of luxury accommodations, the key feature of which is multiple rooms (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Suite_(hotel)\">http://en.wikipedia.org/wiki/Suite_(hotel)</a>).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.'),
	(688,3,14,X'437265617465416374696F6E','CreateAction','The act of deliberately creating/producing/generating/building a result out of the agent.'),
	(689,3,14,X'56656869636C65','Vehicle','A vehicle is a device that is designed or used to transport people or cargo over land, water, air, or through space.'),
	(690,3,14,X'4D617373','Mass','Properties that take Mass as values are of the form \'&lt;Number&gt; &lt;Mass unit of measure&gt;\'. E.g., \'7 kg\'.'),
	(691,3,14,X'5061796D656E744D6574686F64','PaymentMethod','<p>A payment method is a standardized procedure for transferring the monetary amount for a purchase. Payment methods are characterized by the legal and technical structures used, and by the organization or group carrying out the transaction.</p>\n\n<p>Commonly used values:</p>\n\n<ul>\n<li>http://purl.org/goodrelations/v1#ByBankTransferInAdvance</li>\n<li>http://purl.org/goodrelations/v1#ByInvoice</li>\n<li>http://purl.org/goodrelations/v1#Cash</li>\n<li>http://purl.org/goodrelations/v1#CheckInAdvance</li>\n<li>http://purl.org/goodrelations/v1#COD</li>\n<li>http://purl.org/goodrelations/v1#DirectDebit</li>\n<li>http://purl.org/goodrelations/v1#GoogleCheckout</li>\n<li>http://purl.org/goodrelations/v1#PayPal</li>\n<li>http://purl.org/goodrelations/v1#PaySwarm</li>\n</ul>\n'),
	(692,3,14,X'506F7374616C41646472657373','PostalAddress','The mailing address.'),
	(693,3,14,X'416E73776572','Answer','An answer offered to a question; perhaps correct, perhaps opinionated or wrong.'),
	(694,3,14,X'436F6C6C656374696F6E50616765','CollectionPage','Web page type: Collection page.'),
	(695,3,14,X'566964656F47616D65','VideoGame','A video game is an electronic game that involves human interaction with a user interface to generate visual feedback on a video device.'),
	(696,3,14,X'456E67696E6553706563696669636174696F6E','EngineSpecification','Information about the engine of the vehicle. A vehicle can have multiple engines represented by multiple engine specification entities.'),
	(697,3,14,X'4F70656E696E67486F75727353706563696669636174696F6E','OpeningHoursSpecification','A structured value providing information about the opening hours of a place or a certain service inside a place.</p>\n\n<p>The place is <strong>open</strong> if the <a class=\"localLink\" href=\"http://schema.org/opens\">opens</a> property is specified, and <strong>closed</strong> otherwise.</p>\n\n<p>If the value for the <a class=\"localLink\" href=\"http://schema.org/closes\">closes</a> property is less than the value for the <a class=\"localLink\" href=\"http://schema.org/opens\">opens</a> property then the hour range is assumed to span over the next day.'),
	(698,3,14,X'41706172746D656E74','Apartment','An apartment (in American English) or flat (in British English) is a self-contained housing unit (a type of residential real estate) that occupies only part of a building (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Apartment\">http://en.wikipedia.org/wiki/Apartment</a>).'),
	(699,3,14,X'50726F647563744D6F64656C','ProductModel','A datasheet or vendor specification of a product (in the sense of a prototypical description).'),
	(700,3,14,X'50686F746F6772617068','Photograph','A photograph.'),
	(701,3,14,X'557365416374696F6E','UseAction','The act of applying an object to its intended purpose.'),
	(702,3,14,X'436C6970','Clip','A short TV or radio program or a segment/part of a program.'),
	(703,3,14,X'456D706C6F796565526F6C65','EmployeeRole','A subclass of OrganizationRole used to describe employee relationships.'),
	(704,3,14,X'4C6F636174696F6E4665617475726553706563696669636174696F6E','LocationFeatureSpecification','Specifies a location feature by providing a structured value representing a feature of an accommodation as a property-value pair of varying degrees of formality.'),
	(705,3,14,X'496E7465676572','Integer','Data type: Integer.'),
	(706,3,14,X'506572666F726D616E6365526F6C65','PerformanceRole','A PerformanceRole is a Role that some entity places with regard to a theatrical performance, e.g. in a Movie, TVSeries etc.'),
	(707,3,14,X'4461746146656564','DataFeed','A single feed providing structured information about one or more entities or topics.'),
	(708,3,14,X'4F776E657273686970496E666F','OwnershipInfo','A structured value providing information about when a certain organization or person owned a certain product.'),
	(709,3,14,X'4D6F62696C654170706C69636174696F6E','MobileApplication','A software application designed specifically to work well on a mobile device such as a telephone.'),
	(710,3,14,X'496E76697465416374696F6E','InviteAction','The act of asking someone to attend an event. Reciprocal of RsvpAction.'),
	(711,3,14,X'416972706F7274','Airport','An airport.'),
	(712,3,14,X'5265616C4573746174654167656E74','RealEstateAgent','A real-estate agent.'),
	(713,3,14,X'54726176656C416374696F6E','TravelAction','The act of traveling from an fromLocation to a destination by a specified mode of transport, optionally with participants.'),
	(714,3,14,X'53706F7274735465616D','SportsTeam','Organization: Sports team.'),
	(715,3,14,X'54657874','Text','Data type: Text.'),
	(716,3,14,X'52656E74616C4361725265736572766174696F6E','RentalCarReservation','A reservation for a rental car.</p>\n\n<p>Note: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations.'),
	(717,3,14,X'53706F7274734F7267616E697A6174696F6E','SportsOrganization','Represents the collection of all sports organizations, including sports teams, governing bodies, and sports associations.'),
	(718,3,14,X'44697374616E6365','Distance','Properties that take Distances as values are of the form \'&lt;Number&gt; &lt;Length unit of measure&gt;\'. E.g., \'7 ft\'.'),
	(719,3,14,X'536F6369616C4D65646961506F7374696E67','SocialMediaPosting','A post to a social media platform, including blog posts, tweets, Facebook posts, etc.'),
	(720,3,14,X'457069736F6465','Episode','A media episode (e.g. TV, radio, video game) which can be part of a series or season.'),
	(721,3,14,X'52656E74416374696F6E','RentAction','The act of giving money in return for temporary use, but not ownership, of an object such as a vehicle or property. For example, an agent rents a property from a landlord in exchange for a periodic payment.'),
	(722,3,14,X'4F66666572','Offer','An offer to transfer some rights to an item or to provide a service — for example, an offer to sell tickets to an event, to rent the DVD of a movie, to stream a TV show over the internet, to repair a motorcycle, or to loan a book.</p>\n\n<p>For <a href=\"http://www.gs1.org/barcodes/technical/idkeys/gtin\">GTIN</a>-related fields, see <a href=\"http://www.gs1.org/barcodes/support/check_digit_calculator\">Check Digit calculator</a> and <a href=\"http://www.gs1us.org/resources/standards/gtin-validation-guide\">validation guide</a> from <a href=\"http://www.gs1.org/\">GS1</a>.'),
	(723,3,14,X'55736572496E746572616374696F6E','UserInteraction','UserInteraction and its subtypes is an old way of talking about users interacting with pages. It is generally better to use <a class=\"localLink\" href=\"http://schema.org/Action\">Action</a>-based vocabulary, alongside types such as <a class=\"localLink\" href=\"http://schema.org/Comment\">Comment</a>.'),
	(724,3,14,X'5061796D656E7453746174757354797065','PaymentStatusType','A specific payment status. For example, PaymentDue, PaymentComplete, etc.'),
	(725,3,14,X'566964656F47616D65536572696573','VideoGameSeries','A video game series.'),
	(726,3,14,X'43686F6F7365416374696F6E','ChooseAction','The act of expressing a preference from a set of options or a large or unbounded set of choices/options.'),
	(727,3,14,X'4974656D4C6973744F7264657254797065','ItemListOrderType','Enumerated for values for itemListOrder for indicating how an ordered ItemList is organized.'),
	(728,3,14,X'4F72646572416374696F6E','OrderAction','An agent orders an object/product/service to be delivered/sent.'),
	(729,3,14,X'506179416374696F6E','PayAction','An agent pays a price to a participant.'),
	(730,3,14,X'53746F7265','Store','A retail good store.'),
	(731,3,14,X'4D75736963416C62756D','MusicAlbum','A collection of music tracks.'),
	(732,3,14,X'496E666F726D416374696F6E','InformAction','The act of notifying someone of information pertinent to them, with no expectation of a response.'),
	(733,3,14,X'50726F706572747956616C756553706563696669636174696F6E','PropertyValueSpecification','A Property value specification.'),
	(734,3,14,X'44656C69766572794576656E74','DeliveryEvent','An event involving the delivery of an item.'),
	(735,3,14,X'496D6167654F626A656374','ImageObject','An image file.'),
	(736,3,14,X'4F7267616E697A6174696F6E','Organization','An organization such as a school, NGO, corporation, club, etc.'),
	(737,3,14,X'4C6F63616C427573696E657373','LocalBusiness','A particular physical business or branch of an organization. Examples of LocalBusiness include a restaurant, a particular branch of a restaurant chain, a branch of a bank, a medical practice, a club, a bowling alley, etc.'),
	(738,3,14,X'47697665416374696F6E','GiveAction','<p>The act of transferring ownership of an object to a destination. Reciprocal of TakeAction.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/TakeAction\">TakeAction</a>: Reciprocal of GiveAction.</li>\n<li><a class=\"localLink\" href=\"http://schema.org/SendAction\">SendAction</a>: Unlike SendAction, GiveAction implies that ownership is being transferred (e.g. I may send my laptop to you, but that doesn\'t mean I\'m giving it to you).</li>\n</ul>\n'),
	(739,3,14,X'5265706F7274','Report','A Report generated by governmental or non-governmental organization.'),
	(740,3,14,X'57696E416374696F6E','WinAction','The act of achieving victory in a competitive activity.'),
	(741,3,14,X'4475726174696F6E','Duration','Quantity: Duration (use <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601 duration format</a>).'),
	(742,3,14,X'4865616C7468416E64426561757479427573696E657373','HealthAndBeautyBusiness','Health and beauty.'),
	(743,3,14,X'546178695265736572766174696F6E','TaxiReservation','A reservation for a taxi.</p>\n\n<p>Note: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use <a class=\"localLink\" href=\"http://schema.org/Offer\">Offer</a>.'),
	(744,3,14,X'466F6F644576656E74','FoodEvent','Event type: Food event.'),
	(745,3,14,X'44617465644D6F6E657953706563696669636174696F6E','DatedMoneySpecification','A DatedMoneySpecification represents monetary values with optional start and end dates. For example, this could represent an employee\'s salary over a specific period of time. <strong>Note:</strong> This type has been superseded by <a class=\"localLink\" href=\"http://schema.org/MonetaryAmount\">MonetaryAmount</a> use of that type is recommended'),
	(746,3,14,X'5265706C616365416374696F6E','ReplaceAction','The act of editing a recipient by replacing an old object with a new object.'),
	(747,3,14,X'5061796D656E7443686172676553706563696669636174696F6E','PaymentChargeSpecification','The costs of settling the payment using a particular payment method.'),
	(748,3,14,X'5265736572766174696F6E5061636B616765','ReservationPackage','A group of multiple reservations with common values for all sub-reservations.'),
	(749,3,14,X'4C6F6467696E67427573696E657373','LodgingBusiness','A lodging business, such as a motel, hotel, or inn.'),
	(750,3,14,X'4C656E64416374696F6E','LendAction','<p>The act of providing an object under an agreement that it will be returned at a later date. Reciprocal of BorrowAction.</p>\n\n<p>Related actions:</p>\n\n<ul>\n<li><a class=\"localLink\" href=\"http://schema.org/BorrowAction\">BorrowAction</a>: Reciprocal of LendAction.</li>\n</ul>\n'),
	(751,3,14,X'4D656469614F626A656374','MediaObject','A media object, such as an image, video, or audio object embedded in a web page or a downloadable dataset i.e. DataDownload. Note that a creative work may have many media objects associated with it on the same web page. For example, a page about a single song (MusicRecording) may have a music video (VideoObject), and a high and low bandwidth audio stream (2 AudioObject\'s).'),
	(752,3,14,X'486F757365','House','A house is a building or structure that has the ability to be occupied for habitation by humans or other creatures (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/House\">http://en.wikipedia.org/wiki/House</a>).'),
	(753,3,14,X'4C6973744974656D','ListItem','An list item, e.g. a step in a checklist or how-to description.'),
	(754,1,17,X'5265736F75726365','Resource','The class resource, everything.'),
	(755,1,17,X'436C617373','Class','The concept of Class'),
	(756,1,17,X'4C69746572616C','Literal','This represents the set of atomic values, eg. textual strings.'),
	(757,1,17,X'436F6E7461696E6572','Container','This represents the set Containers.'),
	(758,1,17,X'436F6E7461696E65724D656D6265727368697050726F7065727479','ContainerMembershipProperty','The container membership properties, rdf:1, rdf:2, ..., all of which are sub-properties of \'member\'.');
INSERT INTO `resource_template` (`id`, `owner_id`, `resource_class_id`, `label`)
